(3, 'Contact Us', 'contact', 'sub', NULL, '                                                    \n                                                     \n                                                     &lt;div class=&quot;contact-2 content-area-7&quot;&gt;\n     &lt;div class=&quot;container&quot;&gt;\n \n         &lt;div class=&quot;main-title text-center&quot;&gt;\n             &lt;h1&gt;Contact Us&lt;/h1&gt;\n             &lt;p&gt;We waited until we could do it right. Then we did! Instead of creating a carbon copy.&lt;/p&gt;\n         &lt;/div&gt;\n \n         &lt;div class=&quot;row&quot;&gt;\n             &lt;div class=&quot;col-lg-4&quot;&gt;\n                 &lt;div class=&quot;contact-info&quot;&gt;\n                     &lt;div class=&quot;row&quot;&gt;\n                         &lt;div class=&quot;opening-hours bg-light&quot;&gt;\n                             &lt;div class=&quot;col-md-12 col-sm-12 mrg-btn-50&quot;&gt;\n                                 &lt;p&gt;&lt;i class=&quot;flaticon-phone&quot;&gt;&lt;/i&gt;&lt;span&gt;Phone NO:&lt;/span&gt; +12 345 678 7071&lt;/p&gt;\n                             &lt;/div&gt;\n                             &lt;div class=&quot;col-md-12 col-sm-12 mrg-btn-50&quot;&gt;\n                                 &lt;p&gt;&lt;i class=&quot;flaticon-mail&quot;&gt;&lt;/i&gt;&lt;span&gt;Email:&lt;/span&gt; &lt;a href=&quot;/cdn-cgi/l/email-protection&quot; class=&quot;__cf_email__&quot; data-cfemail=&quot;d1b8bfb7be91b5b4bcbeffb2bebc&quot;&gt;[email&amp;nbsp;protected]&lt;/a&gt;&lt;/p&gt;\n                             &lt;/div&gt;\n                             &lt;div class=&quot;clearfix&quot;&gt;&lt;/div&gt;\n                             &lt;div class=&quot;col-md-12 col-sm-12&quot;&gt;\n                                 &lt;h3&gt;Opening Hours&lt;/h3&gt;\n                                 &lt;ul class=&quot;list-style-none&quot;&gt;\n                                     &lt;li&gt;&lt;strong&gt;Monday&lt;/strong&gt; &lt;span&gt; 1