r=&quot;Name *&quot;&gt;\n                         &lt;/div&gt;\n                     &lt;/div&gt;\n                     &lt;div class=&quot;col-md-6&quot;&gt;\n                         &lt;div class=&quot;form-group email&quot;&gt;\n                             &lt;input type=&quot;email&quot; required name=&quot;email&quot; class=&quot;form-control&quot; placeholder=&quot;Email *&quot;&gt;\n                         &lt;/div&gt;\n                     &lt;/div&gt;\n                     &lt;div class=&quot;col-md-6&quot;&gt;\n                         &lt;div class=&quot;form-group number&quot;&gt;\n                             &lt;input type=&quot;tel&quot; required name=&quot;phone&quot;  maxlength=&quot;10&quot; minlength=&quot;10&quot;  class=&quot;form-control&quot; placeholder=&quot;Number *&quot;&gt;\n                         &lt;/div&gt;\n                     &lt;/div&gt;\n                     &lt;div class=&quot;col-md-6&quot;&gt;\n                         &lt;div class=&quot;form-group subject&quot;&gt;\n                             &lt;input type=&quot;text&quot; required name=&quot;subject&quot; class=&quot;form-control&quot; placeholder=&quot;Subject *&quot;&gt;\n                         &lt;/div&gt;\n                     &lt;/div&gt;\n                     &lt;div class=&quot;col-md-12&quot;&gt;\n                         &lt;div class=&quot;form-group message&quot;&gt;\n                             &lt;textarea class=&quot;form-control&quot; required name=&quot;message&quot; placeholder=&quot;Write message *&quot;&gt;&lt;/textarea&gt;\n                         &lt;/div&gt;\n                     &lt;/div&gt;\r\n		     &lt;div class=&quot;col-md-12&quot;&gt;\r\n			&lt;p style=&quot;color: red;&quot;&gt;All * fields are mandatory&lt;/p&gt;\r\n		     &lt;/div&gt;\n                     &lt;div class=&quot;col-md-12&quot;&gt;\n                         &lt;div class=&quot;send-btn text-right&quot;&gt;\n                             &lt;button type=&quot;submit&qu