INSERT INTO `widgets` (`name`, `html`, `updated_at`) VALUES
('contact', '	<div class=\"contact-sec\">\r\n	<div class=\"container-fluid\">\r\n	<div class=\"row\">\r\n		<div class=\"col-lg-12 col-12\">\r\n			<div class=\"heading-sec\">\r\n				<p>See Our Daily News &amp; Updates</p>\r\n				<h2>Contact Us </h2>\r\n				<div class=\"home-icon\">\r\n					<img src=\"assets/images/home.png\">\r\n				</div>\r\n			</div>\r\n		</div>\r\n	<div class=\"row\">\r\n	<div class=\"col-lg-4 col-md-5 col-12\">\r\n	<div class=\"info-sec\">\r\n	<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s</p>\r\n	<div class=\"details\">\r\n	<p><span>Phone</span>+12 345 678 971</p>\r\n	<p><span>Email</span>info@yourmail.com</p>\r\n	</div>\r\n	</div>\r\n	</div>\r\n\r\n	<div class=\"col-lg-8 col-md-7 col-12\">\r\n	<div class=\"contact-form\">\r\n	<style>\r\n	.alert-danger p, .alert-success p {\r\n	font-size: 12px;\r\n	line-height: 10px;\r\n	margin-bottom: 10px;\r\n	text-transform: initial;\r\n	font-weight: 600;\r\n	}\r\n	</style>\r\n\r\n	<div class=\"col-md-12 alert alert-danger\" id=\"frmerror\" style=\"display:none;\">\r\n	</div>\r\n	<div class=\"col-md-12 alert alert-success\" id=\"frmsuccess\" style=\"display:none;\">\r\n	</div>\r\n\r\n	<div class=\"row\">\r\n	<div class=\"col-md-6\">\r\n	<div class=\"md-form\">\r\n	<input name=\"name\" type=\"text\" class=\"form-control\" placeholder=\"Name *\" required=\"\">\r\n	</div>\r\n	</div>\r\n	<div class=\"col-md-6\">\r\n	<div class=\"md-form\">\r\n	<input name=\"email\" type=\"email\" class=\"form-control\" placeholder=\"Email *\" required=\"\">\r\n	</div>\r\n	</div>\r\n	<div class=\"col-md-6\">\r\n	<div class=\"md-form\">\r\n	<input name=\"phone\" type=\"number\" class=\"form-control\" placeholder=\"Phone Number *\" maxlength=\"10\" minlength=\"10\" required=\"\">\r\n	</div>\r\n	</div>\r\n	<div class=\"col-md-12\">\r\n	<div class=\"md-form\">\r\n	<textarea name=\"message\" class=\"form-control\" placeholder=\"Message *\" required=\"\"></textarea>\r\n	</div>\r\n	</div>\r\n	<div class=\"col-md-12\">\r\n	<div class=\"md-form\">\r\n	<button type=\"submit\" id=\"send-message\" name=\"send-message\">Send</button>\r\n	</div>\r\n	</div>\r\n\r\n	</div>\r\n	</div>\r\n	</div>\r\n	</div>                                                \r\n		</div>\r\n	</div>\r\n	</div>    ', '2020-05-28 15:45:43'),
('counters', '&lt;div class=&quot;property-sec&quot;&gt;\n		&lt;div class=&quot;container&quot;&gt;\n			&lt;div class=&quot;row&quot;&gt;\n				&lt;div class=&quot;col-lg-12 col-12&quot;&gt;\n					&lt;div class=&quot;heading-sec&quot;&gt;\n						&lt;h2&gt;Our Proprties&lt;/h2&gt;\n						&lt;div class=&quot;home-icon&quot;&gt;\n							&lt;img src=&quot;assets/images/home.png&quot;&gt;\n						&lt;/div&gt;\n					&lt;/div&gt;\n				&lt;/div&gt;\n			&lt;/div&gt;\n			&lt;div class=&quot;row&quot;&gt;\n				&lt;div class=&quot;col-lg-4 col-md-4 col-12&quot;&gt;\n					&lt;div class=&quot;rent-num&quot;&gt;\n						&lt;h2 id=&quot;no_of_sale_counter&quot;&gt;0&lt;/h2&gt;\n						&lt;p&gt;Listing for Sale&lt;/p&gt;\n						&lt;img src=&quot;assets/images/pro1.png&quot;&gt;\n					&lt;/div&gt;\n				&lt;/div&gt;\n				&lt;div class=&quot;col-lg-4 col-md-4 col-12&quot;&gt;\n					&lt;div class=&quot;rent-num&quot;&gt;\n						&lt;h2 id=&quot;no_of_rent_counter&quot;&gt;0&lt;/h2&gt;\n						&lt;p&gt;Listing for Rent&lt;/p&gt;\n						&lt;img src=&quot;assets/images/pro2.png&quot;&gt;\n					&lt;/div&gt;\n				&lt;/div&gt;\n				&lt;div class=&quot;col-lg-4 col-md-4 col-12&quot;&gt;\n					&lt;div class=&quot;rent-num&quot;&gt;\n						&lt;h2 id=&quot;no_of_short_term_counter&quot;&gt;0&lt;/h2&gt;\n						&lt;p&gt;Listing for Short Term Rent&lt;/p&gt;\n						&lt;img src=&quot;assets/images/pro3.png&quot;&gt;\n					&lt;/div&gt;\n				&lt;/div&gt;\n				&lt;div class=&quot;col-lg-12 col-md-12 col-12&quot;&gt;\n					&lt;div class=&quot;button-sec&quot;&gt;\n						&lt;a href=&quot;/properties&quot;&gt;View All&lt;/a&gt;\n					&lt;/div&gt;\n				&lt;/div&gt;\n			&lt;/div&gt;\n		&lt;/div&gt;\n	&lt;/div&gt;', '2020-05-28 10:18:00'),
